import "./App.css";
import allCountryScores from "./score";

function App() {
  return (
    <div className="App">
      <h1>High Score Per Country</h1>
      <MakeList />
    </div>
  );
}

function MakeList() {
  const newA = allCountryScores.sort((a, b) => a.name.localeCompare(b.name));
  const nameC = newA.map((element, i) => element.name);

  return (
    <div>
      <h2>High Scores: {nameC}</h2>
      <ul>
        <li Key={i}>{element.n}</li>
      </ul>
    </div>
  );
}

export default App;
